import React from "react";
import "./Logo.css";

class Logo extends React.Component {
	render() {
		return (
			<div style={{ display: this.props.display ? "none" : "" }}>
				{console.log(this.props.location.pathname)}
				<img className="logo" src={require("../logos/logo_transparent.png")} alt="" />
			</div>
		);
	}
}

export default Logo;
